$(function () {

    $('[name="order[phone]"]').inputmask("ourphone");

    if (window.errorMessage === undefined) {
        var errorMessage = function (msg) {
            alert(msg);
            return false;
        }
    }

    $('form').submit(function () {


        if ($(this).find('[name="order[fio]"]').length > 0) {

            var name = $(this).find('[name="order[fio]"]').val();

            var rename = /^[a-zA-Zа-яА-ЯёЁ ]*$/i;

            if (name.length == 0) {
                return errorMessage('Вы не заполнили поле "Ф.И.О"');
            }

            if (!rename.test(name)) {
                return errorMessage('Неверно заполнено поле "Ф.И.О"');
            }

        }

        var phone = $(this).find('[name="order[phone]"]').val();
        var clear_phone = phone.replace(/[^0-9]/g, '');

        if (phone.length == 0) {
            return errorMessage('Вы не заполнили поле "Телефон"');
        }

        if (clear_phone.length < 10) {
            return errorMessage('Введен слишком короткий номер телефона');
        }

        if (
            clear_phone.length == 10 &&
            (
                clear_phone.indexOf('7') === 0 ||
                clear_phone.indexOf('8') === 0
            )
        ) {
            return errorMessage('Введен слишком короткий номер телефона');
        }

        if (
            clear_phone.length == 11 &&
            clear_phone.indexOf('7') !== 0 &&
            clear_phone.indexOf('8') !== 0
        ) {
            return errorMessage('Введен слишком длинный номер телефона');
        }

        if (
            clear_phone.length == 12 &&
            clear_phone.indexOf('38') !== 0 &&
            clear_phone.indexOf('37') !== 0
        ) {
            return errorMessage('Введен слишком длинный номер телефона');
        }

        if (clear_phone.length > 12) {
            return errorMessage('Введен слишком длинный номер телефона');
        }

        if (!$(this).find('[name="order[timezone]"]').length) {
            var timezone = $('body').lpFunctions('detectTimezone');
            if (timezone) {
                $('<input/>').attr({
                    'name': 'order[timezone]',
                    'type': 'hidden'
                }).val(timezone).appendTo(this);
            }
        }
        return true;
    });

});


